import "./App.scss";

const numberOfFields = 5;

const matrix = Array.from({ length: numberOfFields }, (_, i) =>
  Array.from({ length: numberOfFields }, (_, i) => ({
    id: i + (Math.random() * 100).toString(),
    value: Math.floor(Math.random() * 10),
  }))
);

console.log(matrix);

function App() {
  return (
    <div className="App">
      <h1>Hello matrix</h1>

      <div style={{ display: "flex", width: "400px", height: "400px" }}>
        {matrix.map((lines, index) => {
          return (
            <div key={index}>
              {lines.map((line, index) => (
                <div
                  style={{
                    border: "1px solid grey",
                    width: "10px",
                    height: "10px",
                  }}
                  key={index}
                >
                  {line.value}
                </div>
              ))}
            </div>
          );
        })}
      </div>
    </div>
  );
}

export default App;
